function Todos(todos) {


  return (
    <div className="todos">
      <div className="todo">{todos.todo}</div>
      <div className="todo__status">{todos.complited}</div>
      <div className="todo__user">{todos.userId}</div>
    </div>
  );
}

export default Todos;
